import React from 'react';
import './App.css';
import { TodoCounter } from './components/TodoCounter';
import { TodoSearch } from './components/TodoSearch';
import { TodoList } from './components/TodoList';
import { TodoItem } from './components/TodoItem';
import { CreateTodoButton } from './components/CreateTodoButton';

function App() {
  const defaultTodos = [
    {
      text: 'Cortar cebolla',
      completed: false,
    },
    {
      text: 'Hacer curso de React',
      completed: false,
    },
    {
      text: 'Tomar agua',
      completed: false,
    },
    {
      text: 'Hacer ejercicios',
      completed: false,
    },

  ];

  return (
    <React.Fragment>
      <TodoCounter completedTodos={4} totalTodos={8} />
      <TodoSearch />

      <TodoList>
        <TodoItem />
        <TodoItem />
        <TodoItem />
      </TodoList>

      <CreateTodoButton />
    </React.Fragment>
  );
}

export default App;
